INSERT INTO `articles` VALUES (1,'Hướng dẫn chọn laptop học tập 2024','huong-dan-chon-laptop-hoc-tap-2024',1,1,1,0,'Gợi ý cấu hình, cân đối chi phí và thời lượng pin cho sinh viên, nhân viên văn phòng.','/uploads/1743480176135-macbook-m4[1].png','<p>Chọn laptop cần ưu tiên CPU tiết kiệm điện, SSD tối thiểu 512GB và màn hình chống chói. Đừng quên kiểm tra cổng USB-C để sẵn sàng kết nối màn hình phụ và sạc nhanh.</p>','2020-04-24 03:35:28',0,1,'2024-04-21 06:22:28'),(2,'Checklist build PC chơi game 2K mượt','checklist-build-pc-choi-game-2k-muot',1,1,1,0,'Danh sách linh kiện cân bằng hiệu năng cho dàn PC chơi game và stream.','/uploads/2024-01-10-05-33-46-PC Gaming - Sniper I4060Ti - BL.jpg','<p>Khi build PC 2K, hãy ưu tiên CPU 6 nhân, RAM 32GB, GPU RTX 4060 trở lên và bộ nguồn chuẩn 80 Plus Gold. Sắp xếp airflow thông thoáng để giữ nhiệt độ ổn định khi chiến game.</p>','2020-04-25 15:22:03',0,1,'2024-04-21 06:23:12'),(3,'5 phụ kiện smarthome đáng mua cho văn phòng','5-phu-kien-smarthome-dang-mua-cho-van-phong',1,1,1,0,'Tối ưu không gian làm việc với ổ cắm thông minh, camera IP và bộ định tuyến WiFi 6.','/uploads/0f37353bf7920923c26f981c17450166.jpg','<p>Ổ cắm thông minh giúp hẹn giờ thiết bị, camera IP quan sát linh hoạt, cảm biến nhiệt độ cảnh báo sớm. Kết hợp router WiFi 6 và hub USB-C để hoàn thiện hệ sinh thái công nghệ cho văn phòng hiện đại.</p>','2020-04-25 15:37:10',1,1,'2024-04-21 06:23:55');
